import React from "react";
import { Paper } from "@material-ui/core"

const Dashboard = () => {
  return (
    <React.Fragment>
      <Paper style={{ with: '10%' }}>
        <div
          className='col-md-6 offset-md-3'
          style={{ maxWidth: '35%', position: 'absolute' }}
        >
          <strong>{"WELCOME BOARD"}</strong>
        </div>
      </Paper>
    </React.Fragment>
  )
}

export default Dashboard;
